import React from 'react'
import './HackerNews.css'

export default function HackerNews() {
    return (
        <table className="hackerNews">
            <Navbar />

        </table>
    )
}


// Header -- logo and links

const Navbar = () => {
 return (<tr className="header">
        <td><a href=""><img src="https://news.ycombinator.com/y18.gif" alt=""/></a></td>
        <td className="l"><a href="#">Hacker News </a></td>
        <td><a href="#">new | </a></td>
        <td><a href="#">past | </a></td>
        <td><a href="#">comment | </a></td>
        <td><a href="#">ask | </a></td>
        <td><a href="#">show | </a></td>
        <td><a href="#">jobs | </a></td>
        <td><a href="#">submit</a></td>
        <td><a href="#">login </a></td>
        </tr>
 )}
